description:
Tecplot Focus is engineering plotting software that allows you to quickly plot all your engineering and test data exactly the way you want. Featuring extensive XY, 2D and 3D capabilities, Tecplot Focus is designed for measured field data, performance plotting of test data, mathematical analysis, and engineering plotting in general.

Description:
Tecplot Focus gets you answers faster. It enables you to quickly plot all your engineering and test data exactly the way you want. Analyze and explore complex datasets, arrange multiple XY, 2D and 3D plots, and communicate your results to colleagues and management with brilliant, high-quality output. Save even more time and effort by automating routine data analyses and plotting tasks. 
